//快速画表格
//numx:列个数
//numy:行个数
//lenx:表格宽度
//leny:表格高度
void draw_grid(u16 x, u16 y, u8 lenx, u8 leny, u8 numx, u8 numy)
{
	u8 row, column;	//行列
	for (row=0; row<numy; row++)		//行
	{
		for (column=0; column<numx; column++)		//列
		{
			LCD_DrawRectangle(x+column*lenx, y+row*leny, (x+column*lenx)+lenx-1,(y+row*leny)+leny-1);
		}
	}

}


//快速填表格字符串
//numx:列个数
//numy:行个数
//lenx:表格宽度
//leny:表格高度
//size:12/16/24
void print_grid(u16 x, u16 y, u8 lenx, u8 leny, u8 numx, u8 numy, u8 size, const u8 str[][20], u8 choose)
{

	u8 row, column, num_str;	//行列
	num_str = 0;
	for (row=0; row<numy; row++)		//行
	{
		for (column=0; column<numx; column++)		//列
		{
			if(num_str==choose)
			{
				POINT_COLOR = GRED;
				LCD_ShowString(x+column*lenx, y+row*leny, lenx, 24, size, *(str+num_str));
				num_str++;
				POINT_COLOR = RED;
			}
			else
			{
				LCD_ShowString(x+column*lenx, y+row*leny, lenx, 24, size, *(str+num_str));
				num_str++;
			}

		}
	}
}


void lcd_freq(float freq, u16 x, u16 y)
{
	u8 len = 8;
	u8 strtmp[40];
//	LCD_Fill(x, y, x+12*15, y+24, BACK_COLOR);

    if(freq < 1000)
    {
    	if(freq < 10)
    		sprintf(strtmp, "%1.6f", freq);
    	else if(freq < 100)
    		sprintf(strtmp, "%2.5f", freq);
    	else
    		sprintf(strtmp, "%3.4f", freq);
		LCD_ShowString(x, y, 12*len, 24, 24, strtmp);
		LCD_ShowString(x+len*12+6, y, 12*3, 24, 24, "Hz ");
    }
    else if(freq < 1000000)
    {
    	double tmp = freq/1000;

    	if(tmp < 10)
    		sprintf(strtmp, "%1.6f", tmp);
    	else if(tmp < 100)
    		sprintf(strtmp, "%2.5f", tmp);
    	else
    		sprintf(strtmp, "%3.4f", tmp);
		LCD_ShowString(x, y, 12*len, 24, 24, strtmp);
		LCD_ShowString(x+len*12+6, y, 12*3, 24, 24, "kHz");
    }
    else if(freq < 1000000000)
    {
    	double tmp = freq/1000000;

    	if(tmp < 10)
    		sprintf(strtmp, "%1.6f", tmp);
    	else if(tmp < 100)
    		sprintf(strtmp, "%2.5f", tmp);
    	else
    		sprintf(strtmp, "%3.4f", tmp);
		LCD_ShowString(x, y, 12*len, 24, 24, strtmp);
		LCD_ShowString(x+len*12+6, y, 12*3, 24, 24, "MHz");
    }
    else
    {
    	LCD_Fill(x, y, x+12*len, y+24, BACK_COLOR);
    	LCD_ShowString(x, y, 12*len, 24, 24, "no");
    }
}

